webpackJsonp([0xa80ac6e3f0f3],{5033:function(e,a){e.exports={data:{post:{html:'<p>ETPers working on taxes (a list in progress): <a href="http://cuwu.editthispage.com/2000/02/20">curmudgeon</a> <a href="http://array.editthispage.com/2000/02/21">array</a>. I just finished my <i>1998</i> German taxes in December. <i>Hee hee</i></p>\n<p>German income tax is like US income tax back in the \'70s. Very complicated and very expensive. Lots of rules and lots of deductions. The fifty-percent tax bracket is alive and well. However, my experience is that, unlike the American IRS, the German Finanzamt is staffed by living, feeling human beings. It\'s a local office rather than a faceless national bureaucracy.</p>\n<p>Another <a href="http://shanson.editthispage.com/stories/storyReader$125">German ETP Site</a>: <a href="http://jcmetzger.editthispage.com/">t√§gliche Nachrichten</a> As far as I can tell, only the the title is German, but I won\'t be fussy</p>\n<p><a href="http://www.hardocp.com/news_images/2000/february_2000/bsod.jpg"><img src="http://shanson.editthispage.com/picture$160" align="right" border="0" /></a>From debian-devel: <a href="http://www.hardocp.com/news_images/2000/february_2000/bsod.jpg">Blue Screen of Death</a></p>\n<p><a href="http://www.ftd.de/cgi-bin/gx.cgi/AppLogic+FTContentServer?pagename=HomePage">Financial Times Deutschland</a> A new national business newspaper in Germany. <i>It\'s pink, like the UK version.</i></p>',fields:{title:"Monday",date:"21 Feb 2000",url:"https://papascott.de/2000-02-21-monday/"}}},pathContext:{slug:"/2000-02-21-monday/",prev:{fields:{title:"Sunday",date:"20 Feb 2000",slug:"/2000-02-20-sunday/"}},next:{fields:{title:"Tuesday",date:"22 Feb 2000",slug:"/2000-02-22-tuesday/"}}}}}});
